"use strict";
//comparison operator ( == )
let wedClasses = 5; // comparison
let tueClasses = 7;
//equality checking
let compare = wedClasses == tueClasses;
console.log(compare);
//  comparison + data type checking  ( === )
let compareType = wedClasses === tueClasses;
console.log(compareType);
//not equal to operator  ( != )
let dressColour = "Black";
let Dupattacolour = "jet black";
let dupattaColour = "Red";
console.log(dressColour != Dupattacolour);
console.log(Dupattacolour != dupattaColour);
